import React, {Component} from 'react';
import {Form, Button, Row, Col, ListGroup, Alert, Modal, Container, FormControl} from 'react-bootstrap'
import {useState, useEffect, useRef} from 'react'
import Media from "./Media";
import SocialMedia from "./SocialMedia";
import baseService from "../services/baseService";
import DragableList from "../customComponents/DragableList";
import SubScriptionControl from "./SubScriptionControl";
import MapView from "../customComponents/MapView";
import {confirmAlert} from 'react-confirm-alert'; // Import
import 'react-confirm-alert/src/react-confirm-alert.css'; // Import css

class PlaceLocationSelections extends Component {
    state = {
        categories: [],
        locations: [],
        selectedSubCategoryId: 0,
        selectedLocationIndex: 0,
        selectedCategoryIndex: 0,
        place:{}


    };
    onLocationChange = (e) => {
        console.log('onLodationChange')
        this.setState({selectedLocationIndex: e.target.selectedIndex,
            selectedCategoryIndex: 0,
            selectedSubCategoryIndex: 0})
    };
    onCategoryChange = (e) => {
        console.log('Category change')
        this.setState({selectedCategoryIndex: e.target.selectedIndex})
    };
    onSubCategoryChange = (e) => {

        console.log('SubCategory change')
        this.setState({selectedSubCategoryIndex: e.target.selectedIndex})
    };
    update = () =>{
        if(this.props && this.props.update)
            this.props.update(this.state.selectedLocationIndex,this.state.selectedCategoryIndex,this.state.selectedSubCategoryIndex)
    };

    checkEdit = (props) =>{
        //then it's a place and we need to edit it
        if(props && props.edit){
            let place = props.place;
            //we have to set the selected location Indexes
            let selectedLocationIndex = this.state.locations.findIndex((singleLocation) => singleLocation._id === place.location._id);
            let selectedCategoryIndex = this.state.locations[selectedLocationIndex].categories.findIndex((singleCategory) => singleCategory._id === place.category._id)
            let selectedSubCategoryIndex = this.state.locations[selectedLocationIndex].categories[selectedCategoryIndex].subCategories.findIndex((singleSubCategory) => singleSubCategory._id === place.subCategory);
            console.log('subCategories are ',this.state.locations[selectedLocationIndex].categories[selectedCategoryIndex].subCategories, '\n findinng ',place.subCategory);
            console.log('selected location index',selectedLocationIndex,'\n categ ind',selectedCategoryIndex,'\n sub cat index',selectedSubCategoryIndex)
            this.setState({selectedLocationIndex,selectedCategoryIndex,selectedSubCategoryIndex})

        }
    };

    checkProps = (props) => {
        if(props && props.locations){
            this.setState({locations:props.locations,categories:props.categories});
            this.checkEdit(props);
        }
    };

    componentWillMount() {
        this.checkProps(this.props);

    }

    componentWillReceiveProps(nextProps, nextContext) {
            this.checkProps(nextProps);
    }


    render() {
        return (
            <div>
                <Form.Group>

                    <Form.Row>
                        <Form.Group as={Col}>

                            <Form.Label>
                                Please choose location
                            </Form.Label>
                            <FormControl as={'select'} onChange={this.onLocationChange}
                                         value={this.state.selectedLocationIndex}>
                                {this.state.locations.map((location, index) => {
                                    return (
                                        <option key={index}
                                                value={this.state.selectedLocationIndex}>{location.name} / {location.nameAr}</option>
                                    )
                                })}
                            </FormControl>
                        </Form.Group>

                        <Form.Group as={Col}>

                            <Form.Label>
                                Please choose Category
                            </Form.Label>
                            <FormControl as={'select'}
                                         onChange={this.onCategoryChange}
                                         value={this.state.selectedCategoryIndex}
                            >
                                {this.state.locations[this.state.selectedLocationIndex] &&
                                this.state.locations[this.state.selectedLocationIndex].categories.map((category, index) => {
                                    return (
                                        <option key={index}
                                                value={index}>{category.name} / {category.nameAr}</option>
                                    )
                                })}
                            </FormControl>
                        </Form.Group>

                        <Form.Group as={Col}>

                            <Form.Label>
                                Choose SubCategory
                            </Form.Label>
                            <FormControl as={'select'}
                                         onChange={this.onSubCategoryChange}
                                         value={this.state.selectedSubCategoryIndex}
                            >
                                {this.state.locations[this.state.selectedLocationIndex] &&
                                this.state.locations[this.state.selectedLocationIndex].categories[this.state.selectedCategoryIndex].subCategories.map((category, index) => {
                                    return (
                                        <option key={index} value={index}>{category.name} / {category.nameAr}</option>
                                    )
                                })}
                            </FormControl>
                        </Form.Group>


                    </Form.Row>
                </Form.Group>

            </div>
        );
    }
}

export default PlaceLocationSelections;
